/**
 * a functor class of the application.
 * get the value from the HTML form and 
 * create a JSON object for HTTP POST.
 * 
 * @author h.adachi
 */
class EntryFactory {
    
    ///////////////////////////////////////////////////////////////////////////
    // public methods
    
    create() {
        // convert the form data to JSON.
        let param = {};
        $($("#entry-form").serializeArray()).each(
            function(i, v) {
                param[v.name] = v.value;
            }
        );
        return $.toJSON(param);
    }
}


